uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// User-defined parameters via JSON
uniform float u_speed;
uniform float u_fov;
uniform float u_camera_dist;
uniform float u_fractal_complexity;
uniform float u_glow_intensity;

out vec4 fragColor;

// --- UTILS ---
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

float sdBox(vec3 p, vec3 b) {
    vec3 q = abs(p) - b;
    return length(max(q, 0.0)) + min(max(q.x, max(q.y, q.z)), 0.0);
}

// --- FRACTAL ENGINE ---
// Inspired by Mandelbox/IFS logic for tech-like circuitry
float map(vec3 p) {
    float d = 1e10;

    // Create a repeating lattice
    vec3 p_lattice = p;
    float cell = 4.0;
    p_lattice.z = mod(p_lattice.z, cell) - cell * 0.5;

    // Fractal Iterations
    vec3 q = p_lattice;
    float scale = 1.0;

    for(int i = 0; i < 4; i++) {
        q = abs(q) - vec3(0.5, 0.8, 0.4);
        q.xy *= rot(0.5 + float(i) * 0.2);
        q.yz *= rot(0.3);

        // Mirroring and Scaling
        float s = 1.8 / clamp(dot(q, q), 0.3, 1.2);
        q *= s;
        scale *= s;
    }

    // Geometry: Thin plates and wires
    float wires = length(q.xy) / scale - 0.002;
    float plates = sdBox(q, vec3(1.5, 0.05, 1.2)) / scale;

    return min(wires, plates);
}

// --- LIGHTING ---
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.001, 0.0);
    return normalize(vec3(
        map(p + e.xyy) - map(p - e.xyy),
        map(p + e.yxy) - map(p - e.yxy),
        map(p + e.yyx) - map(p - e.yyx)
    ));
}

void main() {
    // 1. Setup Coordinates
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    float time = iTime * u_speed * 0.2;

    // 2. Parallel Rail Camera System
    // We move along Z, but orbit around the center structure
    float z_pos = time * 5.0;
    vec3 pathPos = vec3(0.0, 0.0, z_pos);

    // Camera orbital movement
    float angle = time * 0.3;
    vec2 railVec = vec2(cos(angle), sin(angle)) * u_camera_dist;

    vec3 ro = pathPos;
    ro.xy += railVec;

    // Target look-ahead
    vec3 ta = vec3(0.0, 0.0, z_pos + 10.0);
    ta.xy += railVec * 0.7; // Look slightly inward to see the fractal structure passing by

    // Construct Ray
    vec3 fwd = normalize(ta - ro);
    vec3 right = normalize(cross(vec3(0, 1, 0), fwd));
    vec3 up = cross(fwd, right);
    vec3 rd = normalize(fwd * u_fov + uv.x * right + uv.y * up);

    // 3. Raymarching (Volumetric/Transparent Style)
    vec3 color = vec3(0.0);
    float t = 0.0;
    float glow = 0.0;
    float transparency = 1.0;

    for(int i = 0; i < 80; i++) {
        vec3 p = ro + rd * t;
        float d = map(p);

        // Accumulate "tech glow" based on proximity
        float g = 0.01 / (0.02 + abs(d));
        glow += g;

        // If we hit a surface (or get very close)
        if(d < 0.002) {
            vec3 n = getNormal(p);
            float fresnel = pow(1.0 - max(0.0, dot(-rd, n)), 3.0);

            // Electronic Cyan/Blue palette
            vec3 surfCol = vec3(0.1, 0.5, 1.0) * fresnel * 2.0;
            color += surfCol * transparency;

            // Thin surface behavior: don't stop immediately, fade out
            transparency *= 0.8;
            d = 0.05; // Step forward to find next layer
            if(transparency < 0.05) break;
        }

        t += max(d * 0.5, 0.01);
        if(t > 30.0) break;
    }

    // 4. Final Color Composition
    // Add glowing "void" color
    vec3 glowCol = vec3(0.05, 0.15, 0.3) * glow * u_glow_intensity;
    color += glowCol;

    // Tech Grid Background
    float grid = (sin(uv.x * 50.0) * sin(uv.y * 50.0));
    color += vec3(0.2, 0.4, 0.8) * pow(grid, 10.0) * 0.05;

    // Atmospheric fog
    color = mix(color, vec3(0.005, 0.01, 0.02), 1.0 - exp(-0.05 * t));

    // Post-processing
    color = pow(color, vec3(0.8)); // Gamma correction
    color *= 1.2 - dot(uv, uv);    // Vignette

    fragColor = vec4(color, 1.0);
}
